import React from 'react';

class Portfolio extends React.Component {
  render() {
    return (
      <div className="portfolio">
         <div className="portfolio-header">
                <h2 className="portfolio-title">Portfolio</h2>
                <div className="portfolio-separator"></div>
            </div>
            <div className="portfolio-accordions">
                <div className="portfolio-images">
                    <div className="portfolio-image-1"></div>
                    <div className="portfolio-image-2"></div>
                </div>
                <div className="portfolio-item portfolio-item-fashion">01&nbsp;&nbsp;<span>Fashion</span></div>
                <div className="portfolio-item portfolio-item-art">02&nbsp;&nbsp;<span>Art</span></div>
                <div className="portfolio-item portfolio-item-design">03&nbsp;&nbsp;<span>Design</span></div>
                <div className="portfolio-item portfolio-item-styling">04&nbsp;&nbsp;<span>Styling</span></div>
            </div>
      </div>
      );
     }
 }
 
export default Portfolio;
